import React from "react";
import { Table, TableProps } from "react-virtualized";
import LoggingTableColunm from "./loggingTableColunm";


interface IProps extends TableProps{

}

const LogTable: React.FC<IProps> = (props) =>{
    const {rowRenderer} = props
    
    const cellDataGetter = React.useCallback((colomnData: any, key: string, rowData: any) =>{

    },[])
   

    return(
        <Table {...props}>
            {LoggingTableColunm({dataKey: "id", width: 50, cellDataGetter: (cell) => cellDataGetter(cell.columnData, cell.dataKey, cell.rowData)})}
            {LoggingTableColunm({dataKey: "type", width: 50})}
            {LoggingTableColunm({dataKey: "message", width: 50})}
        </Table>
    )
} 

export default LogTable
